				}
			}
		} // if ($deep)

		$this->collFacturas = null;
		$this->collDocumCcs = null;
		$this->collCobross = null;
			$this->aTipoCli = null;
			$this->aZona = null;
			$this->aSegmento = null;
			$this->aVendedor = null;
			$this->aCtaIngr = null;
	}


  public function __call($method, $arguments)
  {
    if (!$callable = sfMixer::getCallable('BaseClientes:'.$method))
    {
      throw new sfException(sprintf('Call to undefined method BaseClientes::%s', $method));
    }

    array_unshift($arguments, $this);

    return call_user_func_array($callable, $arguments);
  }


} // BaseClientes
